INSERT INTO `company_comments` VALUES (1,'Pedía que volviera a los 65$-66$ para poder acumular a buenos precios y me ha dado la oportunidad (si sigue cayendo seguiré comprando). El invierno empezó bien, con bastantes nevadas en la zona de los granes lagos, pero luego se ha apagado y está siendo un invierno como los dos últimos. Cuando esto ocurre y mientras la parte de fertilizantes con la agricultura no mejore (las materias primas llevan también unas semanas de caídas), nos dará oportunidades.','http://invertirendividendos.com/proyecto-cartera-de-inversion-ied-9/',111,1,'2017-04-04 15:09:28','2018-02-11 18:29:11','2017-03-30'),(2,'Una de las mejores gestoras de USA, pero especializada en fondos de gestión activa. La salida de fondos hacía gestión pasiva ha hecho que cotice por debajo del PER mínimo medio de los últimos años de forma frecuente. Sigue generando una montaña de FCF que permite aumentar el dividendo sin riesgo a corto plazo.','http://invertirendividendos.com/proyecto-cartera-de-inversion-ied-9/',112,1,'2017-04-04 15:12:08','2018-02-11 18:30:08',NULL),(3,'empresa en el Top 10 de los líderes mundiales del sector alimentación-consumo. Tras la caída de ventas en 2016 la cotización se ha resentido, cayendo por debajo de los 60 dólares donde la RPD supera el 3,20%. Como dato lleva repartiendo dividendos más de 116 años seguidos. En la zona de 55-59 dólares realizaría mi primera entrada','http://www.elfarmaceuticoactivo.com/p/candidatas.html',114,1,'2017-04-04 15:16:20','2018-02-11 18:30:44',NULL),(4,'empresa belga lider mundial en la producción y venta de cerveza. Actualmente tiene el 22% de su sector a nivel mundial. Sería un complemento perfecto para mis Diageo. La quiero en el entorno a los 95 euros, donde la RPD estaría entorno al 3,5%.','http://www.elfarmaceuticoactivo.com/p/candidatas.html',115,1,'2017-04-04 15:19:13','2018-02-11 18:31:41',NULL),(5,'íder mundial del sector eléctrico con 50% del negocio en Estados Unidos, la quiero por debajo de 900p y con el cambio actual. En estos precios la RPD superaría el 4,5%.','http://www.elfarmaceuticoactivo.com/p/candidatas.html',116,1,'2017-04-04 15:49:45','2018-02-11 18:32:35',NULL),(6,'	\r\ntercera empresa a nivel mundial por ventas del sector consumo (ropa-deporte) tras Nike y Adidas. Hice mi primera entrada en 52,70 dólares, parece que la acción puede seguir cayendo. Tengo marcados los 47-48 dólares para la segunda entrada donde la RPD sería del 4%.','http://www.elfarmaceuticoactivo.com/p/candidatas.html',117,1,'2017-04-04 15:51:56','2018-02-11 18:33:15',NULL),(7,'l','http://www.elfarmaceuticoactivo.com/p/candidatas.html',118,1,'2017-04-04 15:54:37','2017-06-05 13:58:07','2017-03-30'),(8,'empresa española líder sel sector de fabricación y mantenimiento de ascensores, el 51% pertenece a la estadounidense UTX. Por debajo de los 7,5 euros nos ofrece una RPD del 4,2%. Parece que puede empezar a despegar tras los malos años desde el 2008.','http://www.elfarmaceuticoactivo.com/p/candidatas.html',119,1,'2017-04-04 15:56:37','2018-02-11 18:34:31',NULL),(9,'En seeking alpha dicen que no es una buena opción para el largo plazo, pero el dividendo está muy bien actualmente (4,4%)','https://seekingalpha.com/article/4059537-target-worst-performing-dividend-aristocrat-past-decade',120,1,'2017-04-05 16:28:03','2018-02-11 12:15:58','2017-03-31'),(10,'En este otro artículo de seeking alpha la ponen bien...','https://seekingalpha.com/article/4060249-tales-dividend-champions-demise-overstated',120,1,'2017-04-05 16:31:18','2018-02-11 12:15:40','2017-04-04'),(11,'Dividend Aristocrat','',120,1,'2017-04-05 16:32:11','2017-04-05 22:50:21','2017-04-05'),(12,'Tiempos difíciles','http://www.enciclopediafinanciera.com/analisis-de/Target-Corp.html',120,1,'2017-04-06 15:49:34','2018-02-11 12:16:05','2017-02-28'),(13,'Las ventas navideñas han sido algo peores de lo previsto y ha tocado mínimos de 52 semanas, así que he estado buscando algunas noticias. \r\nhttp://www.morningstar.com/stocks/xnys/tgt/quote.html\r\n\r\nComentan que tiene un moat bajo y mucha competencia de amazon y wal-mart, aunque está invirtiendo mucho en comercio electrónico. Recomiendan esperar fuera del valor. A mi me preocupa que no sea capaz de levantar cabeza frente a esos dos monstruos. \r\nhttp://news.morningstar.com/articlen...aspx?id=788728\r\n\r\nTambién acaban de cambiar a su director de marketing: \r\nhttp://www.investopedia.com/stock-an...artner=YahooSA\r\n\r\nPor su parte amazon se alía con salesforce para reforzarse mutuamente en comercio eléctrico, servicios en la nube y plataformas interactivas: \r\nhttp://finance.yahoo.com/news/why-sa...162227433.html','http://www.invertirenbolsa.info/foro-inversiones/showthread.php?10167-Target-Corporation-La-competencia-de-Walmart/page2',120,1,'2017-04-06 16:22:00','2018-02-11 12:16:10','2017-01-22'),(14,'Importantes barreras de entrada','https://moatsandvalue.com/2014/05/31/1o-parte-moats-analisis-visa-vs-mastercard/',121,1,'2017-04-07 15:13:14','2017-04-07 15:13:14','2014-05-31'),(15,'al. El balance está sano, la cuenta de resultados es correcta, la empresa no ha dejado de tener beneficios, tiene un flujo de caja también sano (aunque 2017 será de mucho trabajo en este sentido), con una directiva que me gusta en cuanto a su prudencia a la hora de repartir dividendos y un negocio que deja unos márgenes muy superiores a los que me podía imaginar cuando empecé a analizar la empresa. El mayor y casi único borrón es el tema de la deuda, que no es despreciable y que tiene un calendario muy mejorable, pero son cosas que tienen solución, los aspectos más fundamentales están sanos','http://www.eldividendo.com/compass-minerals/',111,1,'2017-04-17 15:41:51','2018-02-11 18:29:04','2017-04-17'),(16,'dispone de terrenos con minas en Ontario para extraer sal a un coste muy bajo y que tiene una situación geográfica única para este proceso. No es que sea una de las minas más grandes del mundo para la extracción de sal, sino que además está muy bien localizada cerca de los Grandes Lagos, lo que provoca que el coste sea reducido y puedan suministrar de forma muy eficiente por todo Estados Unidos. Simplemente para las compañías competidoras de Compass Minerals les es prácticamente imposible poder replicar el territorio a disposición de la empresa.','http://www.autorizadored.es/ventaja-competitiva/#13Warren_Buffett_y_Charlie_Munger_en_Berkshire_Hathaway',111,1,'2017-04-17 16:30:05','2018-02-11 18:29:19','2016-04-20'),(17,'Resumiendo todo un poco, hoy tenemos una empresa que se está reorganizando, pero que no piensa perder dinero en este proceso, buenas noticias. La cuenta de resultados está bien, mejor de lo que aparenta porque han tenido algún problemilla con impuestos que no se volverá a repetir. EL balance no tiene humo y la deuda es cómoda y muy fácil de pagar con el flujo de caja que generan, no hay problema porque tienen las cosas bien planificadas','http://www.eldividendo.com/target/',120,1,'2017-04-18 22:22:45','2018-02-11 12:15:29','2017-04-17'),(18,'El valor contable queda en 12,3','http://www.eldividendo.com/ebro-foods/',125,1,'2017-04-19 19:15:44','2017-04-19 19:15:44','2016-10-20'),(19,'Años de incremento consecutivo del dividendo: 14 \r\nCalificación de riesgo crediticio: A+ \r\nEPS payout: 69,51 % \r\nRentabilidad: 4,05 % \r\nIncremento anual del dividendo en los últimos \r\n1 año: 11,29 % \r\n3 años: 16,77 % \r\n5 años: 19,91 % \r\n10 años: 16,49 % \r\nChowder: 23,96 % \r\nCrecimiento anual previsto en los próximos 4 años: 8,15 % \r\nPrecio por debajo de media máximo/mínimo 52 semanas: -7,47 % \r\nTratamos aquí esta compañía hace bien poco tiempo.','https://proyecto4millones.blogspot.com/2017/04/candidatos-la-compra-del-mes-de-abril.html#more',126,1,'2017-04-20 21:10:02','2018-02-11 18:36:57','2017-04-09'),(20,'Un análisis interesante para revisar.','https://proyecto4millones.blogspot.com/2017/02/qualcomm-ofrece-valor-con-una.html',126,1,'2017-04-20 21:10:36','2018-02-11 18:37:05','2017-02-11'),(21,'Años de incremento consecutivo del dividendo: 44 \r\nCalificación de riesgo crediticio: A \r\nEPS payout: 60,22 % \r\nRentabilidad: 3,10 % \r\nIncremento anual del dividendo en los últimos \r\n1 año: 15,04 % \r\n3 años: 18,69 % \r\n5 años: 18,56 % \r\n10 años: 12,17 % \r\nChowder: 21,66 % \r\nCrecimiento anual previsto en los próximos 4 años: 7,61 % \r\nPrecio por debajo de media máximo/mínimo 52 semanas: -5,21 %','https://proyecto4millones.blogspot.com/2017/04/candidatos-la-compra-del-mes-de-abril.html#more',117,1,'2017-04-20 21:13:13','2018-02-11 18:33:22','2017-04-09'),(22,'percibo que es una buena empresa en buenas manos y que el mercado, pasándose de frenada, quizás la hace cotizar a un precio atractivo para lo que podría quedar de aquí a unos años.','https://www.rankia.com/blog/ecos-solares/3435323-next-plc-nxt-comprar-buenas-empresas-sectores-problematicos-castigados',127,1,'2017-05-04 14:31:15','2018-02-22 19:56:19','2017-05-04'),(23,'revisar','http://www.invertirenbolsa.info/foro-inversiones/archive/index.php/t-10523.html',132,1,'2017-05-10 22:17:12','2017-05-10 22:17:12','2017-05-10'),(24,'revisar','http://cincodias.elpais.com/cincodias/2017/01/24/mercados/1485247411_812758.html',132,1,'2017-05-10 22:17:29','2017-05-10 22:17:29','2017-05-10'),(25,'Hablan de dividendo seguro y crecimientos de doble dígito.','http://www.aol.co.uk/money/2017/05/11/bt-group-plcs-high-dividend-yield-could-help-fund-your-retireme/',128,1,'2017-05-11 15:08:08','2018-02-22 19:55:38','2017-05-10'),(26,'Reduciran en 4000 personas la plantilla y la directiva no recibirá el bonus.','http://www.proactiveinvestors.co.uk/companies/news/177640/bt-slashes-jobs-and-ceo-forfeits-bonus-as-full-year-profit-drops-after-accounting-scandal-177640.html',132,1,'2017-05-11 15:12:37','2018-02-22 19:53:52','2017-05-11'),(27,'La empresa tiene en la caja fuerte nada menos que casi $13 billones que es lo mismo que 8.50$ por acción que son de los accionistas. \r\nLa empresa va muy bien desde hace muchos años. \r\nEmpresa con imagen seria y cumplidores. Pueden ser un poco caros, pero justifican precios con calidad. \r\nGran dependencia de VIH y Hepatitis. \r\nEstán desarrollando otras líneas de negocio fuera de estas especialidades. \r\nNunca había pagado dividendo hasta el año pasado, parece que los ingresos extra están haciendo que sobre el dinero. \r\nPeligro en las estimaciones porque estos ingresos no serán eternos. \r\nEl valor contable no tiene sentido aquí, es muy bajo. El PER tampoco tiene sentido, es menor a 8 en estos momentos, pero está claro que esto es falso y se irá Dividendocorrigiendo con el paso del tiempo y la bajada en las ventas de esta cura.','http://www.eldividendo.com/gilead/',133,1,'2017-05-23 19:58:38','2018-02-22 19:53:11','2016-05-16'),(28,'Menos de PER 7x y dividendo superior al 3%. Recompra acciones, tiene 10.000 millones en caja y en 2017 podrían ganar sólo $7 u $8 de BPA. Sigo sin entender bien por qué cotiza tan barata. Difícil no ganar dinero aquí, pero en Bolsa nada es seguro. Me lo pensaré si entro o no.','https://dividendorentable.blogspot.com/2017/05/punto-de-mira-mayo-2017.html',133,1,'2017-05-23 20:12:10','2018-02-22 19:53:05','2017-05-15'),(29,'	\r\nEmpresa británica del sector \"retail\" que cotiza a PER 12x aproximadamente, da un dividendo de casi el 4%. Además, tiene intención de dar 4 dividendos especiales trimestrales este año. En los últimos años ha recomprado acciones, aunque en 2017 parece que no lo va a hacer, según pude leer cuando presentaron los últimos resultados anuales.\r\n\r\nY, ¡sorpresa!, Paramés la tiene en uno de sus Fondos de Inversión.','https://dividendorentable.blogspot.com/2017/05/punto-de-mira-mayo-2017.html',127,1,'2017-05-23 20:17:48','2018-02-22 19:56:12','2017-05-15'),(30,'Los cereales no se perciben como sanos y está perdiendo cuota de mercado mes a mes.','http://www.elespanol.com/ciencia/salud/20170524/218478825_0.html',114,1,'2017-05-26 14:41:15','2018-02-11 18:31:04','2017-05-25'),(31,'Cincinnati Financial Corp. es una compañía de seguros diversificada que vuela bajo el radar de la mayoría de los inversionistas. Con una capitalización de mercado de alrededor de 11 mil millones de dólares, es aproximadamente un tercio del tamaño de los grandes como TRV y Allstate ALL. Tomemos como prueba, por ejemplo, sus siete trimestres consecutivos de superar las expectativas de ganancias en un 10% o más. O tomar sus más de 50 años de aumentos consecutivos de dividendos. La fiabilidad de esta empresa la hace muy atractiva si usted está preocupado por la turbulencia del mercado en los próximos meses.','https://igdigital.com/2017/04/las-5-empresas-con-los-mejores-dividendos/',138,1,'2017-05-26 21:01:25','2018-02-22 19:50:00','2017-04-01'),(32,'Las acciones sanitarias quedaron un poco flotando en el aire despu','https://igdigital.com/2017/04/las-5-empresas-con-los-mejores-dividendos/',118,1,'2017-05-26 21:02:42','2017-05-26 21:02:42','2017-04-01'),(34,'Ford obtuvo unos beneficios de 10.400 millones de dólares en 2016, espera que se reduzcan hasta los 9.000 en 2017 y que mejoren en 2018.','http://www.eldiario.es/economia/Ford-beneficios-impuestos-millones-dolares_0_625388591.html',136,1,'2017-05-26 21:16:58','2018-02-22 19:51:02','2017-03-25'),(35,' se han cargado al CEO:','http://www.cazadividendos.com/foros/tema/ford-f/',136,1,'2017-05-26 21:17:42','2017-05-26 21:17:42','2017-05-22'),(36,'WGL Holdings Inc. (WGL) Washington Gas Light Company es una utility que da servicio al distrito de Columbia y áreas cercanas como Maryland y Virginia. Está bastante diversificada, con divisiones de electricidad, gas, exploración, transporte, etc. Fundada en 1848, reparte de forma ininterrumpida dividendos a sus accionistas desde 1852 y forma parte de los aristócratas USA, al llevar incrementando el dividendo durante 39 años. Rentabilidad actual: 3.0%\r\n\r\n','http://invertirendividendos.com/los-centenarios-del-dividendo/',142,1,'2017-05-26 21:25:26','2018-02-22 19:48:17','2015-12-11'),(37,'	\r\nFundada en 1816, es responsable de la gestión del servicio del agua y su reciclaje en los condados de York y Adams, Pennsylvania. Reparte dividendos desde el año de su fundación (1816) y tiene el récord de continuidad en el reparto de dividendos con casi 200 años. Lleva 19 años de incrementos continuos. Rentabilidad actual: 2,6%.','http://invertirendividendos.com/los-centenarios-del-dividendo/',144,1,'2017-05-26 21:30:57','2018-02-22 19:47:27','2015-12-11'),(38,'Otro de las grandes compañías de productos de consumo a nivel mundial presente en sectores de cuidado bucal, personal y del hogar, así como nutrición de mascotas. Presente en más de 220 países tiene una historia centenaria, repartiendo dividendos de forma continua desde 1895 y también acompaña a las anteriores como uno de los reyes del dividendo (supera los 50 años exigidos y alcanza los 52 años de incremento continuo). Rentabilidad actual 2,3%','http://invertirendividendos.com/los-centenarios-del-dividendo/',145,1,'2017-05-26 21:32:48','2018-02-22 19:46:52','2015-12-11'),(39,'Uno de los líderes del sector de productos de consumo (limpieza, cuidado y aseo personal, etc.). Posee muchas de las marcas líderes es estos sectores, un verdadero conglomerado de marcas de primer nivel que le da una estabilidad a su negocio envidiable. PG ha repartido dividendo desde 1891, es uno de los reyes del dividendo USA (más de 50 años de incremento, lleva en concreto 58 años de aumento continuo) y tiene una rentabilidad actual de 3,4%','http://invertirendividendos.com/los-centenarios-del-dividendo/',134,1,'2017-05-26 21:33:16','2018-02-22 19:52:11','2015-12-11'),(40,'Se pasó 6 años sin dividendo (2006 - 2012)','',136,1,'2017-05-29 12:07:53','2018-02-22 19:50:52','2017-05-29'),(41,'El banco canadiense Bank of Montreal lleva más de 100 años pagando dividendos - concretamente desde 1829.','https://www.rankia.com/blog/aprendiendo-a-invertir/3586041-dividensaurios-mas-100-anos-repartiendo-dividendos',155,1,'2017-05-30 16:28:41','2018-02-22 19:42:22','2017-05-30'),(42,'Desde 1877 no ha habido interrupciones en sus dividendos.','https://www.rankia.com/blog/aprendiendo-a-invertir/3586041-dividensaurios-mas-100-anos-repartiendo-dividendos',143,1,'2017-05-30 16:29:20','2017-05-30 16:29:20','2017-05-30'),(43,'Tiene más dinero en caja que cualquier otra empresa dedicada a la biotecnología','https://www.fool.com/investing/2017/05/28/7-things-you-didnt-know-about-gilead-sciences-inc.aspx',133,1,'2017-06-01 16:08:56','2018-02-22 19:52:59','2017-05-27'),(44,'Se trata de una compañía de calidad (AA-) que en la actualidad abona una rentabilidad del 2,5 % y, dadas sus excelentes relaciones entre el dividendo y tanto los beneficios como el flujo de caja libre, tiene margen para continuar subiéndolo en los próximos años. La cuadruplicación de su deuda puede resultar inquietante, y sin duda ha afectado a sus resultados, pero todavía se mantiene dentro de cifras manejables (relación entre deuda y EBITDA de 1,68 y posibilidad de pagar la deuda con menos de cuatro años de flujo de caja libre)','https://proyecto4millones.blogspot.com/2017/04/w-w-grainger-un-distribuidor-industrial.html',157,1,'2017-06-01 19:52:58','2018-02-22 19:41:51','2017-04-23'),(45,'Las previsiones de GWW indican que tras los ajustes de precios, volverían a tener un margen operativo del 12~13% en 2019, el margen previsto para 2017 es del 10,7%.\r\n\r\nPor cierto, es posible que el Q2 2017 también sea flojo, ya que hablan de que en el Q2 todavía estarán reorganizando los precios, y que para el principio Q3 ya estaría todo listo para comenzar a recuperar el margen de beneficio.','http://www.invertirenbolsa.info/foro-inversiones/showthread.php?9809-W-W-Grainger/page2',157,1,'2017-06-01 20:00:42','2018-02-22 19:41:41','2017-05-30'),(46,'El pasado 18 de abril, IBM anunció que en el primer trimestre de este año sus beneficios netos cayeron un 13,1%, hasta los 1.750 millones de dólares, por encima de lo esperado en el mercado. Sus ingresos también retrocedieron un 2,8%, hasta los 18.155 millones de dólares.','http://cincodias.elpais.com/cincodias/2017/05/05/companias/1493987963_134563.html',158,1,'2017-06-02 16:27:24','2018-02-22 19:40:54','2017-05-05'),(47,'\r\nYo si estoy dentro desde los 32.5 que me ejercieron una PUT, asi que mi precio medio esta en 31.8$. La empresa (pagina 14 del informe anual con fecha de enero 17) estima que en el peor de los casos, las ventas de Copaxone supondr','http://www.invertirenbolsa.info/foro-inversiones/showthread.php?11179-Teva-Farma-An%E1lisis-Fundamental-y-T%E9cnico',118,1,'2017-06-05 13:58:24','2017-06-05 13:58:24','2017-06-05'),(48,'Me Gusta:\r\nL','http://www.elfarmaceuticoactivo.com/2016/11/invertir-en-medicamentos-genericos.html',118,1,'2017-06-05 14:01:35','2017-06-05 14:01:35','2016-11-16'),(49,'En el primer trimestre las ventas retroceden hasta los 686 millones (15,4% de caída):','http://www.cazadividendos.com/foros/tema/mattel-mat/',139,1,'2017-06-08 22:04:13','2018-02-22 19:49:36','2017-04-23'),(50,'Respecto a Enbridge, parece que con la compra de Spectra Energy se está convirtiendo en todo un gigante del sector energético. En su página web afirman que uno de sus objetivos es el aumento anual del dividendo un 10-12% hasta 2024. Morningstar cree que es probable que sean capaces de hacerlo en los próximos 5 años. De ser así se podría alcanzar un YOC realmente bueno. Con un yield ahora del 4.2%, y suponiendo 10% CAGR tendríamos: \r\nAño 1 4.2% \r\nAño 2 4.62% \r\nAño 3 5.082% \r\nAño 4 5.59% \r\nAño 5 6.15%','http://www.cazadividendos.com/foros/tema/compras-y-ventas-de-empresas-estadounidenses/page/7/',159,1,'2017-06-14 19:52:46','2018-02-22 19:39:39','2017-04-28'),(51,'El negocio de servicios de infraestructuras para el sector petrolero y gasístico continúa consolidándose. El último movimiento corporativo de la industria se anunció ayer: Enbridge, el operador canadiense de oleoductos y gasoductos, comprará Spectra Energy por 28.000 millones de dólares, la mayor compra internacional que jamás ha llevado a cabo una firma canadiense.\r\n\r\nEste movimiento resultará en la creación del mayor gestor de infraestructuras para el sector energético de todo Norteamérica. Será durante el primer trimestre de 2017 cuando se cierre la operación, que tiene pendiente el visto bueno de los reguladores.','http://www.eleconomista.es/mercados-cotizaciones/noticias/7807721/09/16/Enbridge-compra-Spectra-por-28000-millones-de-dolares.html',159,1,'2017-06-14 19:53:38','2018-02-22 19:39:45','2016-09-06'),(52,'ENB is a member of Canadian Dividend All-Star List with a 21 year streak of dividend increases. Dividend growth rates for 1, 3, 5 and 10 years are 14.0, 18.9 , 17.6 and 13.9.','http://dividendhawk.blogspot.fi/2017/05/recent-buy-enbridge-inc-enbto.html',159,1,'2017-06-14 19:54:55','2018-02-22 19:39:32','2017-05-10'),(53,'Esperan aumentar un 10% el dividendo cada año hasta 2024','',159,1,'2017-06-14 20:01:11','2018-02-22 19:39:26','2017-06-14'),(54,'	\r\nMorningstar considera que no tiene ninguna ventaja competitiva y moderada incertidumbre en la determinación de su precio justo. En estos momentos cotiza con una prima cercana a un 20 % (55,08 $) por encima de su P/AFFO de 15 esperado en diciembre de 2017 (45,90 $) y cuando lleguen a la cuenta los fondos del mes de julio, consideraremos esta compañía y este precio a la hora de decidir nuestra compra mensual.','https://proyecto4millones.blogspot.com/2017/06/realty-income-una-posicion-central-de.html',135,1,'2017-06-14 20:36:15','2018-02-22 19:51:38','2017-06-12'),(55,'Creo que el payout es muy alto, revisar','',160,1,'2017-06-16 14:09:26','2017-06-16 14:09:26','2017-06-16'),(56,'Lo paso a rojo. Cada año tiene más acciones, el dividendo van a tener que recortarlo \r\nPodría ser por la compra de EE?','',132,1,'2017-06-16 21:36:30','2018-02-22 19:53:46','2017-06-16'),(57,'Recompra acciones','',127,1,'2017-06-16 21:45:40','2017-06-16 21:45:40','2017-06-16'),(58,'Parece que lleva muchos años sólo subiendo un 3%','',134,1,'2017-06-19 13:48:29','2018-02-22 19:52:05','2017-06-19'),(59,'Segun seekingalpha está sobreevaluado, es muy pequeña para que valga tanto','https://seekingalpha.com/article/4081365-absurdity-york-waters-valuation',144,1,'2017-06-19 16:13:55','2018-02-22 19:47:20','2017-06-14'),(60,'Para los que no est','http://www.elfarmaceuticoactivo.com/2017/06/compra-de-acciones.html',118,1,'2017-06-21 19:39:42','2017-06-21 19:39:54','2017-06-17'),(61,'Aquí hablan de malas prácticas como activar servicios que los clientes no piden y les han demandado','http://www.econotimes.com/IMPORTANT-CENTURYLINK-INC-INVESTOR-ALERT-Wolf-Haldenstein-Adler-Freeman-Herz-LLP-announces-that-a-securities-class-action-lawsuit-has-been-filed-in-the-United-States-District-Court-for-the-Southern-District-of-New-York-against-CenturyLink-Inc-783289',140,1,'2017-06-29 21:15:17','2018-02-22 19:49:02','2017-06-29'),(62,'Hace un mes compraron yahoo.... Casi es preferible comprar AT&T antes que verizon','http://dividendlife.com/2017/07/04/may-stock-purchases-and-a-sale/',160,1,'2017-07-05 16:03:37','2017-07-05 16:03:37','2017-07-04'),(63,'Gregorio dice que no para largo y sí para medio (con riesgo). Se comenta que tiene mucha deuda: REVISAR\r\n\r\nPueden pasar dos cosas, principalmente:\r\n\r\n1) Si la deuda realmente es muy alta, lo mejor es no comprar, porque estaría débil, y sería peligroso que tuviera que ampliar capital, etc.\r\n\r\n2) Si la situación es mejor de lo que parece, por lo que he comentado, entonces esta podría ser una ruptura falsa, y sería buen momento de comprar.\r\n\r\nPor la posición del MACD, creo que lo más probable es el escenario 2, y que sea una buena compra. Como la figura no es muy clara, ahora haría una compra parcial, entre la mitad y la cuarta parte del dinero destinado a esta operación.','http://www.invertirenbolsa.info/foro-inversiones/showthread.php?11330-Ford-An%E1lisis-Fundamental-y-T%E9cnico',136,1,'2017-07-05 19:09:16','2018-02-22 19:50:47','2017-07-05'),(64,'Está muy endeudada y le puede afectar una subida de tipos, lo comentan en el foro de cazadividendos','',115,1,'2017-07-06 14:47:55','2018-02-11 18:31:58','2017-07-06'),(65,'Es canadiense, me van a sablear con la retención en origen (25%)','',159,1,'2017-07-10 15:06:56','2018-02-22 19:39:20','2017-07-10'),(67,'Bienvenido al foro, Xavi.\r\n\r\nGracias, yoe. Generalmente la media mensual de 200 es una compra clarísima en cualquier empresa de calidad. En IBM, y en todas. Si miráis gráficos mensuales lo veréis. Lo que pasa es que tocan esa media cada muchos años, por lo que no se puede comprar sólo ahí. Pero cuando se puede comprar ahí, generalmente es suelo, y muy buena oportunidad de compra.\r\n\r\nWaits y Argos, tenéis razón, sí. Es mala idea copiar a otros. Muchas veces, además, los grandes inversores no hacen lo que parece, porque hacen operaciones combinadas de acciones y derivados, y no se conoce públicamente la parte de los derivados, sólo la de las acciones.\r\n\r\nMuy interesantes los enlaces, Blopa, y muy buena la reflexión.\r\n\r\nIBM es tecnológica, que es un sector no apto para el largo plazo. Lo que pasa es que es una tecnológica especial, y creo que sí es apta para el largo plazo. Pero preferiblemente en un porcentaje de la cartera inferior a la media. Yo creo que IBM tiene barreras de entrada suficientes, pero no es un negocio tan estable como otros, tiene que \"reinventarse\" cada X años. Lo que pasa es que para el largo plazo es una de las opciones más seguras de tener algo del sector de la tecnología.\r\n\r\nLo que dice Ruimbo es importante. El potencial de Watson creo que es muy alto. Y es muy difícil de replicar, muy pocas empresas pueden hacer algo así. Parecido a pequeña escala, lo pueden hacer más, pero eso no sería igual que Watson. Lo que pasa es lo que decís, que esto aún es un prototipo que está por confirmar.\r\n\r\nyoe, lo del teletrabajo es curioso, cada vez salen más noticias de empresas que lo están retirando, o intentando retirar. Creo que suena atractivo, pero tiene muchas desventajas, y la mayoría de la gente no tiene la mentalidad adecuada para ser más productivo en su casa que en la oficina.\r\n\r\nRicbar, imposible no es. De suceder, sería una buena venta para los accionistas de IBM.\r\n\r\nPara la sociedad, no sería bueno que hubiera unas pocas \"mega empresas\".\r\n\r\nYo estoy de acuerdo con yoe, ahora mismo la tendencia no es muy clara.\r\n\r\nPor fundamentales el precio es bueno, pero no muy bueno. Puede ser suelo, según los resultados que vaya sacando (en el segundo trimestre de 2017 vuelven a bajar, ya son 21 trimestres cayendo las ventas, por la transformación de la empresa). Esto de la transformación, es importante tenerlo en cuenta. IBM seguramente tendrá que hacer más transformaciones importantes en las próximas décadas. Posiblemente tenga unos períodos muy buenos, mejores que otros sectores, y de vez en cuando alguna transformación importante.\r\n\r\n150 es buen precio, pero aún no hay suelo claro:\r\n\r\nIBM mensual.jpg\r\n\r\nEn la media de 200 mensual (los 133 que veis ahora) sí sería una compra muy clara.\r\n\r\nGracias, yoe. Generalmente la media mensual de 200 es una compra clar','http://www.invertirenbolsa.info/foro-inversiones/showthread.php?7964-IBM-An%E1lisis-Fundamental-y-T%E9cnico/page23',158,1,'2017-07-24 14:07:45','2018-02-22 19:40:45','2017-07-19'),(68,'Hoy baja un 15% porque un fármaco contra el cáncer no está dando los resultados previstos en las pruebas de control. Aún así, ha seguido ganando pasta pero como los \'analistas\' esperaban que el medicamento diera 7.000 millones en 2022, pues ya se sabe... \r\nEn los seis meses de enero a junio, AstraZeneca tuvo un beneficio neto de 1.303 millones de dólares (1.113 millones de euros), frente a unas pérdidas de 636 millones de dólares (543 millones de euros) en el mismo periodo de 2016.\r\n\r\nEl beneficio operativo fue de 1.842 millones de dólares (más de 1.570 millones de euros), un 37 % más que en el pr