 y mejoras en la eficiecia. \r\nBeneficio neto de 2016: 4.620 millones de dólares (2015 pérdida de 866 millones de dólares). \r\nAún así, los analistas habían previsto un beneficio de 5.180 millones de dólares. \r\nDividendo anunciado: 1,70 $ \r\nRecompra de acciones previstas en 2017: 500 millones de dólares.','',129,1,'2017-08-09 14:18:42','2018-02-22 19:55:10','2017-02-14'),(104,'Gas Natural vende el 20% de su red distribución en España por 1.500 millones','',25,1,'2017-08-09 14:41:16','2018-02-11 18:20:28','2017-08-09'),(105,'Sin deuda y con ingresos crecientes. Alto payout pero porque no saben que hacer con el dinero','',175,1,'2017-08-09 16:15:08','2017-08-09 16:15:08','2017-08-09'),(106,'En los últimos cinco años, las ventas de la empresa han aumentado un 7,27 % anual. En línea con este incremento, los aumentos anuales en los resultados bruto (7,84 %), de explotación (7,65 %) y neto (8,41 %) se han mantenido en consonancia, dada la estabilidad de los márgenes. Así, el margen bruto ha mejorado un 0,53 % anual, el margen de explotación ha crecido un 0,36 % anual y el margen neto ha mejorado un 1,06 % anual en los últimos cinco años. Paychex tiene un crecimiento continuo, regular y sostenido en la cuenta de resultados.','https://proyecto4millones.blogspot.com/2017/07/paychex-crea-valor-para-el-accionista-y.html',175,1,'2017-08-09 16:15:59','2018-02-19 07:29:23','2017-07-08'),(107,'El valor contable de la acción queda en 5,3$ y tenemos casi que multiplicar por 10 para llegar a la cotización. Esto nos dicen dos cosas, la primera es que la empresa está cara y la segunda es que es un gran negocio que no necesita grandes capitales para que ande y funcione. Esto es una empresa que vomita dinero, lo que a mí tanto me gusta','http://www.eldividendo.com/paychex/',175,1,'2017-08-09 16:16:41','2018-02-19 07:29:37','2017-02-16'),(108,'Resultados del segundo trimestre fiscal de 2017: \r\nBeneficio neto atribuido: 2.388 millones de dólares (+11%). \r\nCifra de negocio:13.336 millones de dólares (+3%).\r\n\r\nResultados del primer semestre fiscal de 2017: \r\nBeneficio: 4.867 millones de dólares (-3%). \r\nIngresos: 28.120 millones de dólares (-0,31%).','',166,1,'2017-08-09 21:04:29','2018-02-22 19:35:21','2017-05-12'),(109,'En la pagina 47 hay una serie de datos que conviene revisar y que me dan como conclusion que el dividendo no es sostenible. Esta tesis ya la tuve en cuenta en mi primera entrada en septiembre del 2015 y la empresa no ha mejorado lo suficiente desde entonces.\r\n\r\nNet cash inflow from operating activities 2,152 \r\nDividends paid to shareholders (2,049) \r\nIncrease in short-term loans 1,930\r\n\r\nEn resumen, la empresa esta utilizando el dinero que genera de su negocio en mantener en marcha el negocio pidiendo prestamos a corto plazo para pagar el dividendo. ¿Cuanto durara esto? Pues hasta que se acabe el dinero que tienen acumulado en el banco\r\n\r\n-> Cash and cash equivalents 3,986 4,590','',26,1,'2017-08-10 13:51:33','2018-02-11 18:21:47','2017-08-10'),(110,'tiene mucha deuda y puede que no puedan mantener el dividendo\r\n','https://seekingalpha.com/filing/3641370#CMP-20170630X10Q_HTM_SC21C70DE86FF50BAB107E2E0166716F8',111,1,'2017-08-21 13:21:06','2017-08-21 13:21:06','2017-08-21'),(111,'Para mí, TRE es por fundamentales una de las compras más claras del IBEX a día de hoy. Así que no le he dado muchas vueltas y he aumentado mi posición a 28,90 euros, subiendo el peso en cartera hasta el 1,80 %. Dejo mi precio medio en 26,50 euros con una RPD muy aceptable. \r\nMe siento a esperar por si baja de los 26 euros, sino no volveré a comprar. A pesar de sus buenos números, pertenece a un sector bastante cíclico donde es bueno tener bajos precios de compra si la quieres para largo plazo. \r\nCon TRE en cartera tenemos una empresa con un dividendo sostenible superior al 4,5% (siempre en efectivo y con histórico superior a 10 años), con un 95% de su negocio fuera de España, con una buena dirección y sin deuda.','http://www.elfarmaceuticoactivo.com/2017/08/seguimos-comprando-una-de-cal-y-otra-de.html',176,1,'2017-08-21 13:52:24','2018-02-19 07:28:40','2017-08-10'),(112,'El pasado martes al cierre del mercado Disney presentó los resultados del primer semestre del 2017, donde podíamos ver una bajada del EPS respecto al año anterior y una pequeña caída en los ingresos. Analizando los resultados la caída es debido a la parte del negocio de medios. Las nuevas plataformas como Netflix están afectando claramente a los resultados. \r\nEse mismo día, Disney anunció que a partir del 2019 creará su propia plataforma y abandonará Netflix. El tiempo dirá si es una buena decisión, a mí me parece acertada, contenidos no le van a faltar. Dice mucho de la dirección esta decisión, ante el primer “problema” de una de las partes de su ebitda, ponen en marcha una medida clara y rotunda. \r\nA pesar de los resultados veo una empresa con un balance robusto y con bastante futuro a largo plazo, cualquiera que sea padre lo entenderá mejor. \r\nTras los resultados, la acción abrió el miércoles con una caída superior al 5%. Aproveche para hacer mi primera entrada en la empresa a un precio de 101,44 dólares, pasando a formar parte de mi cartera con un peso del 0,7%.','http://www.elfarmaceuticoactivo.com/2017/08/seguimos-comprando-una-de-cal-y-otra-de.html',166,1,'2017-08-21 13:53:12','2018-02-22 19:35:12','2017-08-10'),(113,'El incremento de los fondos propios es uno de los síntomas de salud de la empresa, así como la no existencia de deuda, tiene bastante efectivo en tesorería, por lo que una empresa sin deuda no es peligrosa desde el punto de vista de balance.','https://elmonjepacienteblog.wordpress.com/2017/08/19/tecnicas-reunidas/',176,1,'2017-08-21 13:54:24','2018-02-19 07:28:30','2017-08-19'),(114,'Pertenece a un sector defensivo (consumo básico) y tiene un catálogo de productos alimentarios y de bebidas que se ha ampliado al sector de productos para mascotas con la compra de Big Heart Pet Brands. Este movimiento ha aumentado sus ventas casi un 40 % en el último año, a costa de multiplicar por tres la deuda y deteriorar la calificación crediticia de la compañía. La ventaja competitiva de la empresa es estrecha según Morningstar. FastGraphs considera interesante un precio por debajo de 115,49 $, mientras que Morningstar cree que es una oportunidad de compra a un precio de 93,80 $. Nosotros nos conformaríamos con un precio de 104,65 $','https://proyecto4millones.blogspot.com/2017/01/j-m-smucker-interesante-por-debajo-de.html',163,1,'2017-08-24 14:20:35','2018-02-22 19:37:00','2017-01-26'),(115,'Baja un 7%, ha ganado bastante menos que el año pasado','http://www.marketwatch.com/story/jm-smucker-shares-fall-4-premarket-after-earnings-miss-2017-08-24',163,1,'2017-08-24 14:21:02','2018-02-22 19:36:54','2017-08-24'),(116,'Anuncian recompra de acciones por valor de 750 million euros','http://www.unibail-rodamco.com/W/cms_sites/SITE_16406/ressources16406/pdf1/UR_PR_20170814_EN.pdf',110,1,'2017-08-28 16:33:28','2017-08-28 16:33:28','2017-08-15'),(117,'Balance muy mal, la cuenta de resultados floja, muy floja. Lo que va de año no indica que la mejoría de la que hablan se produzca, no hay dinero para pagar dividendos y recompras y están comprando muchas empresas y acciones propias pero con dinero prestado. A pesar de todo ello, la empresa no logra el impulso que necesita para generar beneficios crecientes. La Gráfica de las Lamentaciones ha dado varios avisos (uno ya me mosquea) y no pinta bien. La directiva la despediría, hablan de plantes de ahorro y las cuentas me hablan de derroches y creo que el producto ha perdido las ventajas que tenía.','http://www.eldividendo.com/kelloggs/',180,1,'2017-09-19 19:26:51','2018-02-19 07:25:45','2016-10-01'),(118,'Payout del 100%, insostenible. Paso a rojo','',180,1,'2017-09-19 19:27:09','2017-09-19 19:27:09','2017-09-19'),(119,'En 2017, el beneficio neto se espera en el mismo rango que el de 2016 1.300M€-1.400M€, debido a los mismos factores de este año (precio gas y caída divisas Latam), para empezar a remontar desde 2018. Por lo visto en los primeros 6 meses del año 2017 (casi un 15% menos que en 6 meses de 2016), con suerte se acercará al rango bajo de la horquilla prevista. \r\nA principios de la década se pagó en script, aunque en los documentos de la web lo cuentan como efectivo.','http://invertirendividendos.com/analisis-gas-natural-gas-2016/',25,1,'2017-09-22 16:15:03','2018-02-11 18:20:25','2017-09-21'),(120,'Por lo demás la empresa está muy bien gestionada, con mucha prudencia, la deuda no es un problema, los márgenes son excelentes y el balance está muy limpio, que son puntos muy importantes, además de una directiva que me gusta. El otro foco de problemas viene de la reestructuración que la empresa viene haciendo; de momento llevan dos años de caídas en las ventas y parece que se viene un tercero en la misma línea. No sé cómo acabará la cosa en el futuro pero a día de hoy éste es un foco de preocupación por los inversores, que por eso la tienen dejada un poco de lado. Para una cartera ElDividendo hasta el 6% en plata verde. La empresa es muy buena pero tiene esos 2 problemas importantes; por un lado la caída de ventas que parece que continúa y por el otro el negocio que a mí no me termina de convencer, prefiero cosas más sencillas y menos cambiantes.','http://www.eldividendo.com/qualcomm/',126,1,'2017-09-22 16:16:35','2018-02-11 18:36:54','2017-09-21'),(121,'Resultados del primer semestre de 2017:\r\nBeneficio: 1.366 millones (+9%).\r\nVentas: 11.671 millones (+11,5%).\r\nEbitda: 2.292 millones (+9%).\r\nEbit: 1.744 millones (+9%).\r\nhttp://www.elboletin.com/noticia/153590/mercados/fuertes-caidas-para-inditex-en-bolsa-pese-a-anunciar-un-incremento-del-9-en-el-beneficio.html','',173,1,'2017-09-22 21:53:56','2017-09-22 21:53:56','2017-09-22'),(122,'Ford suspenderá temporalmente varias lineas de producción en cinco plantas norteamericanas por la caída en las ventas: \r\nhttp://www.efeempresas.com/noticia/ford-reduce-produccion-caida-ventas-eeuu/','',136,1,'2017-09-22 21:54:39','2018-02-22 19:50:39','2017-09-22'),(123,'Nike primer cuatrimestre 2018:\r\n\r\n-Ingresos planos \r\n-Beneficio bruto -4% \r\n-Beneficio neto -24%,\r\n\r\n-Ingresos planos\r\n-Beneficio bruto -4%\r\n-Beneficio neto -24%, \r\n','http://www.invertirenbolsa.info/foro-inversiones/showthread.php?9285-Nike-An%E1lisis-Fundamental-y-T%E9cnico/page7',161,1,'2017-09-27 13:50:22','2018-02-22 19:37:45','2017-09-27'),(124,'Resumiendo todo un poco, K C’s es una empresa con un producto fabuloso, con mucho futuro y con unas cuentas que no me gustan. El equipo humano que lo lleva no es de primera, llevan muchos años sin innovación y están dejando que la empresa desaparezca poquito a poquito, cada año hay menos empresa para los accionistas y más deudas que pagar. Esto no puede seguir así. Aquí sí que creo que vendría bien una renovación porque no me gusta nada lo que veo. Me duele en el alma dar mi recomendación, me encantan varios de sus productos y creo que son de los mejores que hay en el mercado tanto en calidad como en precio. Mi produccionrecomendación es negativa. Con estas cuentas, el nivel de deuda, la relación entre corrientes y $500 millones pillados en Venezuela, no se puede decir otra cosa. Algún punto negro puedes tener, pero apuntarte a todos ni por casualidad. Y pensaba yo cuando analicé a J&J que estaban despistados aquéllos por lo de Venezuela, pues vaya fiesta la que me estoy encontrando allá donde miro','',147,1,'2017-09-27 15:01:21','2018-02-22 19:45:50','2015-05-25'),(125,'Sorprendente su cotización, máximos históricos en 121$, acaba de publicar unos resultados mediocres tirando a malos, el beneficio no llega para pagar dividendos y lo han aumentado. Yo la verdad, es que me he tenido que confundir en algo, o no entiendo nada, es una empresa que me gusta como producto, pero estas cuentas me dan pánico, bueno hay muchos que opinan distinto. Con esos precios me quedo con 3M, J&J o P&G, pero hay inversores de todas las opiniones','http://www.eldividendo.com/kimberly-clark/',147,1,'2017-09-27 15:09:33','2018-02-22 19:45:13','2017-05-25'),(126,'Gregorio: Los resultados que pones están bien para lo que se espera de una empresa como esta en este momento. Las divisas les han beneficiado a las empresas USA durante varios años y ahora les perjudican algo, eso no es importante.\r\n\r\nPero la veo algo cara, ese crecimiento no justifica un PER tan alto.\r\n\r\nLa subida desde los 100$, más o menos, yo no la veo justificada con ese crecimiento del 5%, porque no es que a 100$ estuviera muy barata y haya corregido una infravaloración.\r\n\r\nYo con Kimberley seguiría esperando, a estos precios no me parece una buena compra. Si baja entonces le buscaría la entrada, pero mejor por la zona de 100 que por los 120.','http://www.invertirenbolsa.info/foro-inversiones/showthread.php?9450-Kimberly-Clark/page2',147,1,'2017-09-27 15:10:42','2018-02-22 19:45:40','2016-04-04'),(127,'Son 44 años ininterrumpidos de subida de dividendo y a los 122 actuales se corresponde con 3,18% RPD y con el dólar bajando.\r\n\r\nLos resultados del segundo trimestre han sido levemente inferiores al año pasado\r\n\r\n','http://investor.kimberly-clark.com/r...easeID=1034287',147,1,'2017-09-27 15:16:44','2018-02-22 19:45:06','2017-06-27'),(128,'Bajo el precio de compra de 115 a 105 pq no me acaba de gustar lo que leo: que si alto payout, mucha deuda... Será buena, pero la quiero sin riesgo.','',147,1,'2017-09-27 15:22:56','2018-02-22 19:44:54','2017-09-27'),(129,'Morden, lo que le pasaba a General Mills es que estaba muy sobrevalorada, y ahora está volviendo a cotizar a la zona en la que no debería haber dejado de cotizar. Es decir, lo raro y lo que hay que analizar es la subida anterior, no esta caída, que es lo normal.\r\n\r\nlusco, yo creo que sí tiene barreras de entrada suficientes para el largo plazo. Lo que pasa es que no es perfecta, como ninguna empresa lo es, y este sector ha estado demasiado sobrevalorado en la crisis, y lo lógico es que ahora caiga y cotice en las zonas que le corresponde.\r\n\r\nEste es el mensual:\r\n\r\nGM mensual.jpg\r\n\r\n47,50 es un soporte muy importante, y ahí el PER es de 17 veces. Puede ser buena zona de compra, pero la zona de compra realmente buena es la media mensual de 200, los 39-40$, donde el PER es 14 veces (que no es que sea bajísimo, pero probablemente no llegue a cotizar por debajo de esa zona).','http://www.invertirenbolsa.info/foro-inversiones/showthread.php?3399-General-Mills-An%E1lisis-Fundamental-y-T%E9cnico/page5',114,1,'2017-09-27 22:23:51','2018-02-11 18:30:50','2017-09-27'),(130,'	\r\nEstán tardando en hacer los reajustes de procedimientos y personal','http://www.invertirenbolsa.info/foro-inversiones/showthread.php?8840-Royal-Mail-An%E1lisis-Fundamental-y-T%E9cnico/page4',177,1,'2017-09-28 13:50:11','2018-02-19 07:27:00','2017-03-03'),(131,'Resumiendo un poco hoy nos encontramos ante una empresa vieja, oxidada y anticuada que la están reformando. Si lo logran, valdrá mucho más de lo que pagamos ahora mismo, sin problemas el doble y con un futuro de dividendos prometedor. Si no lo logran, pues no digo que vaya a pasar a la historia, pero perderán el negocio bueno y tendrá que conformarse con mediocridades que no quiere nadie y lo que le subvencione el estado por las cartas y demás notificaciones que alguien tienen que hacer. Sus cuentas están muy flojas, pero su deuda es pequeña','http://www.eldividendo.com/royal-mail/',177,1,'2017-09-28 13:51:03','2018-02-19 07:27:06','2015-11-30'),(132,'Tienen un sistema de pensiones que le está costando muchísimo dinero','https://seekingalpha.com/article/4084508-royal-mail-snail-mail-even-slower-moving-stock',177,1,'2017-09-28 13:53:20','2018-02-19 07:26:52','2017-06-28'),(133,'Payout de más del 100%. Paso a rojo','http://financials.morningstar.com/ratios/r.html?t=ROYMF&region=usa&culture=en-US',177,1,'2017-09-28 13:53:47','2018-02-19 07:26:46','2017-09-28'),(134,'Resultados del segundo trimestre de 2017: \r\n\r\nBeneficio neto: 950 millones de dólares (-24%). \r\nFacturación: 9.070 millones de dólares (=). \r\n','https://www.lainformacion.com/economia-negocios-y-finanzas/economia/nike-primer-trimestre-ejercicio-crecimiento_0_1066993592.html ',161,1,'2017-10-02 13:20:38','2018-02-22 19:37:39','2017-09-30'),(135,'	\r\nTécnicas Reunidas es una empresa a tener en cuenta si la situación del precio de crudo se va a revertir en los próximos años. La IEA ha asegurado que es necesario realizar inversiones para equiparar la producción y la demanda de petróleo para las próximas décadas. Actualmente, nos encontramos en un ciclo de contracción de la industria, por eso los resultados de la empresa se han visto afectados negativamente. A largo plazo, la demanda de petróleo superará a la oferta si no se realizan las inversiones necesarias, hecho que beneficiará a Técnicas Reunidas. En definitiva, la empresa se puede considerar APTA PARA LA INVERSIÓN.','http://www.latortugainversora.com/2017/09/27/tecnicas-reunidas/',176,1,'2017-10-02 13:49:20','2018-02-19 07:28:21','2017-09-27'),(136,'Es decir, tiene un exceso de liquidez de 288 millones, pero de eso 288 millones, 174 millones son anticipos de clientes, por lo que el exceso de liquidez \"real\" es de 114 millones.\r\n\r\nSarraceno, a veces pasa que se publica la noticia de posibles contratos, porque la empresa se ha presentado, y parece probable que se lo den, pero aún no se lo han dado.\r\n\r\nRPD, me parecen unos resultados correctos. Ya dijo la empresa que el +21% de BPA en el primer trimestre se había producido porque habían coincidido de casualidad muchos ingresos en el primer trimestre, pero que eso se iba a corregir en los siguientes.\r\n\r\nEn este segundo trimestre el BPA crece el 1%, que ya es lo normal (puede ser algo más a final de año) para Técnicas Reunidas.\r\n\r\nLa caída de la cartera del 23% es mucho en porcentaje, pero sigue siendo una cartera muy alta. Lo que me preocupa es que caiga en los próximos 1-3 años, por el tema de las petroleras','http://www.invertirenbolsa.info/foro-inversiones/showthread.php?6541-T%E9cnicas-Reunidas-An%E1lisis-fundamental-y-Noticias/page19',176,1,'2017-10-02 20:15:39','2018-02-19 07:28:14','2017-10-02'),(137,'En 2016, las ventas se quedan planas respecto a 2015 con 2.459M','http://invertirendividendos.com/analisis-ebro-foods-2017-ebro/',125,1,'2017-10-02 21:45:46','2017-10-02 21:46:12','2017-09-08'),(138,'bles. La empresa está muy bien llevada y va creciendo sin endeudarse a lo tonto. El balance está impoluto con un fondo de comercio controlado y descendiendo, las deudas son prácticamente inexistentes, la política de dividendos es sostenible y la directiva ha demostrado ser prudente y seria. Los márgenes que obtienen son magníficos y la gráfica de las Lamentaciones es de las que muestran las empresas excelentes','http://www.eldividendo.com/bic/',185,1,'2017-10-05 20:44:32','2018-02-19 07:21:49','2017-05-11'),(139,'Walgreens Boots has better growth prospects in the near-term, but CVS is likely to return to higher earnings growth next year and beyond. The market has discounted CVS because of its struggles this year, but its lower valuation and higher dividend yield could make it the better dividend growth stock to buy today. With that said, we like both CVS and Walgreens Boots at current prices.','https://seekingalpha.com/article/4099088-better-dividend-growth-stock-buy-today-cvs-walgreens-boots-alliance?page=2',186,1,'2017-10-09 14:01:52','2017-10-09 14:01:52','2017-08-15'),(140,'CVS Health crea mayor valor para el accionista que Walgreens','https://proyecto4millones.blogspot.com/2016/07/cvs-health-crea-mayor-valor-para-el.html',187,1,'2017-10-09 14:29:26','2017-10-09 14:29:26','2016-07-07'),(141,'Paychex, Inc. today announced total service revenue of $803.1 million for the three months ended August 31, 2017, an increase of 4% from $773.5 million for the same period last year. Net income and