íses emergentes de Latinoamérica y Asia, que está contrarrestando la debilidad en Estados Unidos, a la vez que lleva a cabo sus planes de expansión. Por el lado negativo está el desfavorable comportamiento de las divisas en el trimestre. El Resultado Neto acumulado a septiembre de 2017 crece un 4,6% vs. 9M16 hasta los 92,2 Mn€, del cual 26,0 Mn€ corresponden al 3T (-7,8% vs. 3T16).','',123,1,'2017-10-31 19:10:13','2018-02-11 18:35:47','2017-10-31'),(152,'Default \r\nResultados 9 primeros meses de 2017\r\n\r\n- Gana un 45% menos hasta septiembre debido a la depreciación del dólar \r\n- Adjudicaciones de 2.000 millones de euros en 9M 2017, incluyendo el proyecto de Duqm \r\n- Cartera a Septiembre de 2017: 8.517 millones de euros \r\n- Posición de caja neta de 218 millones de euros\r\n\r\nTRE_Resultados_2017-9M.jpg\r\n\r\nACTUALIZACIÓN DE PREVISIONES\r\n\r\nEn consonancia con el escenario de menor actividad, Técnicas Reunidas presenta nuevas previsiones para el año 2017 y 2018:\r\n\r\nPrevisiones año 2017 \r\nVentas: € 4.900 millones – € 5.000 millones \r\nMargen EBIT: 2,0%\r\n\r\nPrevisiones año 2018 \r\nVentas: €4.300-4.600 millones de euros, impactado por el retraso de los proyectos. \r\nMargen EBIT: entre un 1,5% y un 2,5%, con una recuperación progresiva a lo largo del año. \r\nCompromiso con la política de remuneración al accionista.\r\n\r\nNo prevé alcanzar niveles de carga de trabajo óptimos hasta la segunda mitad de 2018 \r\n- La cartera de pedidos de la compañía alcanza los 8.517 millones de euros, el 16% inferior','http://www.invertirenbolsa.info/foro-inversiones/showthread.php?6541-T%E9cnicas-Reunidas-An%E1lisis-fundamental-y-Noticias/page21',176,1,'2017-11-10 13:23:11','2018-02-19 07:28:01','2017-11-10'),(153,'Resultados de los primeros nueve meses de 2017: \r\nBeneficio: 116,3 millones (-3,9%). \r\nIngresos: 240,5 millones (=). \r\nEbitda: 159 millones (+2,4%). \r\nBeneficio por acción: 1,40 €.','',21,1,'2017-11-13 13:21:11','2018-02-11 12:21:27','2017-11