56','2018-01-01'),(171,'They’ve been paying out an increasing dividend for 20 consecutive years, with a 10-year dividend growth rate of 9.8%.\r\n\r\nWith a payout ratio of 65.7%, near-term dividend growth will probably be moderate.\r\n\r\nStill, you’re also looking at a very healthy 2.49% yield here, which just so happens to exceed both the broader market and SJM’s own five-year average yield.','http://dailytradealert.com/2018/01/02/top-10-stocks-2018/',163,1,'2018-01-12 16:50:25','2018-02-22 19:36:43','2018-01-12'),(172,'Dependiente de economía norteamericana: 90% de las ventas en USA \r\n-Principales competidores: Bed, bath and beyond (en calidad) y luego los target, best buy, wal-mart, amazon ... pero esos están más centrados en el precio. \r\n-La crisis del 2007-2008 le afectó bastante, bajaron sus ingresos brutos cerca de un 20% en 2008 y otro 10% en 2009; pero lo notó más en su margen neto, que bajó al 1% en 2008. \r\nLuego se recuperó muy bien en 2010 (subida de 13% en ventas), pero pasó 2 años malos. \r\n-DATO IMPORTANTE DEL SECTOR: las ventas en tienda física de muebles de hogar representa el 90% de las ventas totales del sector','http://www.invertirenbolsa.info/foro-inversiones/showthread.php?11130',193,1,'2018-01-12 19:50:26','2018-02-19 07:18:24','2017-01-01'),(173,'Mr Free lo pinta muy bien, con crecimientos de dividendo de media de 17% en los últimos años, sin deuda y también tiene e-commerce','http://dailytradealert.com/2018/01/02/top-10-stocks-2018/',193,1,'2018-01-12 19:51:20','2018-02-19 07:18:14','2018-01-08'),(174,'Segun mornigstar, cada año gana más y recompra acciones','',193,1,'2018-01-12 19:59:21','2018-02-19 07:18:02','2018-01-12'),(175,'Payouts muy elevados (87% actualmente) y a veces ha sido de hasta un 250%','',150,1,'2018-01-15 16:17:02','2018-01-15 16:17:02','2018-01-15'),(176,'la política de dividendos no me cuadra, yo creo que los he puesto mal. \r\nIgualmente, la paso a rojo, no me convence','',181,1,'2018-01-22 15:34:44','2018-02-19 07:25:15','2018-01-22'),(177,'Mismos resultados que anterior, el BPA sube un 3% \r\nLa compañía tuvo los mismos ingresos que en el año 2016. Vendió un volumen de producto que fue un 1 % superior al ejercicio anterior, pero bajó un 1 % los precios debido. \r\nEstan reduciendo costes.','https://proyecto4millones.blogspot.com/2018/01/kimberly-clark-aumenta-un-31-su.html',147,1,'2018-01-24 14:43:35','2018-02-22 19:44:47','2018-01-24'),(178,'está subiendo a lo loco, hoy un 14. la paso a amarillo','',157,1,'2018-01-24 14:50:56','2018-02-22 19:41:34','2018-01-24'),(179,'Colgate-Palmolive gana un 17% menos en 2017, hasta 1.627 millones de euros','http://www.expansion.com/empresas/distribucion/2018/01/26/5a6b2e93e5fdead7698b4680.html',145,1,'2018-01-26 16:05:26','2018-01-26 16:05:26','2018-01-26'),(180,'3 razones por las que buffet la comprar','https://seekingalpha.com/article/4136823-3-reasons-buffett-buy-undervalued-grade-energy-giant',159,1,'2018-01-30 14:29:53','2018-01-30 14:29:53','2018-01-11'),(181,'Resultados de 2017:\r\n\r\nEPS 9,84€, +23%\r\n\r\nPER 7\r\n\r\nDividendo 3,65, +12%\r\n\r\nVntas +9%; en coches en china +28%\r\n\r\nEBIT +14%\r\n\r\nCotización -2%','',170,1,'2018-02-02 17:45:11','2018-02-19 07:30:30','2018-02-02'),(182,'Buenos resultados de Unibail en 2017:','http://www.unibail-rodamco.com/W/cms_sites/SITE_16406/ressources16406/pdf1/UR_PRES_FULLYEAR_2017.pdf',110,1,'2018-02-02 17:46:25','2018-02-02 17:46:25','2018-02-02'),(183,'Resultados de 2017:\r\n\r\nBeneficios: 700 millones (-9,7%). \r\nIngresos: 27.984 millones (+3,3%)','http://www.efeempresas.com/noticia/mapfre-gana-27-984-millones-de-euros-2017-33-mas/',28,1,'2018-02-08 10:23:21','2018-02-11 18:24:53','2018-02-08'),(184,'beneficios netos de 4.423 millones de dólares en el primer trimestre de su ejercicio fiscal 2018, un 78 % más que en el mismo periodo del año anterior.\r\n\r\nLa compañía ganó entre octubre y diciembre pasados 2,91 dólares por acción, aunque ese cálculo incluye un beneficio extraordinario de 1.600 millones de dólares derivado de la reciente reforma fiscal aprobada en Estados Unidos.\r\n\r\nSin él, Walt Disney tuvo un beneficio por acción de 1,89 dólares, frente a los 1,55 dólares del año antes, superando las expectativas de los analistas.','https://www.invertia.com/es/-/el-grupo-walt-disney-gano-4-423-millones-en-su-primer-trimestre-un-78-mas',166,1,'2018-02-08 10:32:04','2018-02-22 19:35:04','2018-02-08'),(185,'Resultados anuales 2017:\r\nEl beneficio aumenta un 17,6%\r\nEBITDA sube un 17% hasta 1.110,3 millones de euros\r\nDeuda neta baja desde los 5.089 millones de euros a finales de 2016 hasta los 4.364 millones de euros a cierre de 2017.\r\nEl dividendo de 2017 subió un 5%.\r\n \r\nEn cuanto a los objetivos, se prevé aumentar el dividendo un 5% anual hasta 2020 y reducir la deuda neta hasta los 3.650 millones de euros en 2020.\r\n \r\nMuy muy buenos resultados y me ha sorprendido la gran reducción de deuda que han tenido en un solo año (y reduciendo también el coste de la deuda). Desde luego está claro que ha sido un gran acierto haber aprovechado las últimas caídas de su cotización para crearme una posición completa. He entrado fuerte en Enagás y estoy encantado. Son estas oportunidades que el mercado de vez en cuando nos da y hay que aprovechar.','',24,1,'2018-02-20 13:16:03','2018-02-20 13:16:03','2018-02-20'),(186,'No tocar ni con un palo. Múltiples caídas y subidas y parece que van a cortar el dividendo','',179,1,'2018-02-23 13:25:03','2018-02-23 13:25:03','2018-02-23'),(187,'Confirmado, recortan el dividendo casi a la mitad (0,80)','',179,1,'2018-02-26 13:57:55','2018-02-26 13:57:55','2018-02-26'),(188,'Buffet deja su puesto en el consejo directivo para no tener que viajar tanto','https://seekingalpha.com/news/3333977-buffett-retire-kraft-heinz-board',168,1,'2018-02-26 14:01:07','2018-02-26 14:01:07','2018-02-24'),(189,'Ha presentado hoy resultados anuales y parecen muy buenos, con la acción subiendo casi un 6%.\r\n\r\nSubida de