ManorCare para sus negocios de enfermería especializada, vida asistida, hospicio y atención domiciliaria a QCP.\r\n\r\nTambién se está planteando dejar de ser un REIT','https://www.streetinsider.com/Corporate+News/Quality+Care+Properties+(QCP)+Surges+on+HCR+ManorCare+Deal/13894851.html',37,1,'2018-03-02 21:33:51','2018-03-02 21:33:51','2018-03-02'),(194,'Ab Inbev dispara su beneficio un 64% en 2017:','https://www.eldiario.es/economia/cervecera-AB-InBev-aumento-beneficio_0_745425543.html',115,1,'2018-03-09 14:25:07','2018-03-09 14:25:07','2018-03-09'),(195,'Endesa incrementa sus beneficios en un 4% en 2017:','https://www.vozpopuli.com/economia-y-finanzas/empresas/Endesa-gano-millones_0_1113188787.html',184,1,'2018-03-09 14:31:01','2018-03-09 14:31:01','2018-03-09'),(196,'Presenta unos ingresos de 1.941M€ (prácticamente planos, +0,5%), con un EBITDA que sube un +2,3% a 1.519,5M€ y un beneficio neto de 669,8M€ (sube un 5,2%). El BPA se sitúa en 1,238€\r\nLas inversiones se sitúan en 510,2M€ (se reducen un 20,7% desde los 643,1M€ de 2016), de cuales casi 411,8M€ se han realizado en la red de Transporte de España (+3,3%) y el resto en inversiones internacionales (Chile y Perú fundamentalmente).\r\nLa generación de caja aumenta ligeramente (3,6%) y la reducción de las inversiones hace que el Free Cash Flow aumente notablemente hasta más de 605M€ (desde los 408M€). La caja cubre completamente las inversiones y el dividendo (el FCF es de 605M€ y el pago de dividendo supone 463M€).\r\nLa deuda se reduce ligeramente hasta los 4.791,8M€ (un 3,2% desde 4.949M€), que unido al aumento del EBITDA deja el ratio Deuda/EBITDA en un más que razonable 3,15 (muy contenido para este tipo de compañía). EL 89% de la deuda es a tipo fijo y el 11% a tipo variable, con un tipo medio de 2.78% (se reduce desde el 2,94% de 2016).','http://invertirendividendos.com/resumen-resultados-2017-hcn-vtr-ree/',31,1,'2018-03-12 20:29:37','2018-03-12 20:29:37','2018-03-06'),(197,'La EPS sube un 50% respecto a año anterior. Suben el dividendo un 7% y esperan hacerlo hasta 2020','http://www.stockmarketwire.com/article/5882715/Legal-General-profit-jumps-32pct-dividend-up-7pct.html',128,1,'2018-03-13 16:44:05','2018-03-13 16:44:05','2018-03-13'),(198,'\r\nPepsico va bastante mejor que Coca Cola.\r\n\r\nSi quitamos el efecto extraordinario por la modificación de los impuestos que ha habido en EEUU, en 2017 el BPA sube el 15% hasta 5$.\r\n\r\nAsí que a los 113$ actuales el PER 2017 es de 23 veces. Algo alto, aunque está a mucho mejor precio que Coca Cola, y el negocio también va mejor. Este es un ejemplo más de por qué os insisto tanto en que hay que diversificar mucho (siempre entre buenas empresas). Durante muchos años se consideraba que Coca Cola era mejor que Pepsi, porque a Pepsi el negocio de los aperitivos le lastraba. Coca Coca crecía más, tenía márgenes más altos, etc. Pero en estos casos creo que hay que evitar la tentación de meterlo todo (todo lo de este sector, no todo el patrimonio, eso entiendo que ni se contempla) en una sola. Es mejor diversificar siempre. Ahora Pepsi va mejor que Coca Cola.','http://www.invertirenbolsa.info/foro-inversiones/showthread.php?4029-PepsiCo-An%E1lisis-fundamental-y-t%E9cnico/page4',148,1,'2018-03-15 15:57:16','2018-03-15 15:57:16','2018-03-15'),(199,'Iban a comprar a pfizer su parte de consumer healthcare, pero se al final se echaron para atrás y hoy la cotización sube un 7%\r\n\r\n','https://www.reuters.com/article/us-pfizer-divestiture/reckitt-benckiser-pulls-out-of-pfizer-consumer-health-auction-idUSKBN1GX30J',178,1,'2018-03-22 13:55:27','2018-03-22 13:55:27','2018-03-22'),(200,'Dividendo en riesgo y salud cuestionable. La paso a amarillo','https://seekingalpha.com/article/4158210-general-mills-dividend-now-questionable-health',114,1,'2018-04-04 13:50:51','2018-04-05 15:44:22','2018-04-04'),(201,'GlaxoSmithKline compra una participación en Novartis por 10.470 millones en efectivo','',26,1,'2018-04-04 13:54:52','2018-04-04 13:54:52','2018-04-27'),(202,'Siempre CVS Health. Ya no aparece en el cribado habitual de la lista CCC porque su calificación crediticia ha bajado a BBB tras el anuncio de la compra de Aetna. Pero está, a juicio de FastGraphs, infravalorado, y Morningstar le concede cinco estrellas a su precio actual. El anuncio de que no va a aumentar el dividendo nos retrae de hacer una nueva compra, pero no sé hasta qué punto podremos resistir la tentación.\r\n','https://proyecto4millones.blogspot.com/2018/04/candidatos-la-compra-del-mes-de-abril_4.html',187,1,'2018-04-05 15:56:21','2018-04-05 15:56:21','2018-04-05'),(203,'Aquí tenemos una empresa cuyos beneficios no solo no van a crecer, sino que se espera que se reduzcan un 4 % en el año 2018. Sin embargo, 2019 ya se espera que sea un año mejor y sus beneficios aumentarán un 5 %. Mientras esas previsiones llegan a cumplirse o no, Southern es una empresa sólida (calificación crediticia A-) que paga ahora mismo una rentabilidad de un 5,25 % y cotiza a un precio interesante: no hay más que ver la imagen de FastGraphs y considerar que Morningstar le da cuatro estrellas.','https://proyecto4millones.blogspot.com/2018/04/candidatos-la-compra-del-mes-de-abril_4.html',149,1,'2018-04-05 15:58:01','2018-04-05 15:58:01','2018-04-05'),(204,'Esta empresa de servicios públicos va a comprar la compañía Scana y para obtener el dinero necesario para la misma ha emitido 20 millones de acciones a 67,85 $. La cotización, lógicamente, ha bajado hasta ese precio dejándonos una minusvalía superior al 11 % en nuestra posición. Con una rentabilidad actual del 5 %, a mi juicio Dominion es una excelente oportunidad para los que no hayan iniciado una posición en el valor','https://proyecto4millones.blogspot.com/2018/04/candidatos-la-compra-del-mes-de-abril_4.html',150,1,'2018-04-05 15:58:40','2018-04-05 15:58:40','2018-04-05'),(205,'\r\nUn clásico entre los clásicos de las carteras formadas por compañías que pagan dividendos crecientes. No está cotizando a un precio heroico, sino simplemente alrededor de una correcta valoración (tres estrellas Morningstar). Nos gustaría ver una rentabilidad del 3 % antes de ampliar nuestra posición, lo que correspondería con un precio de 112 $, pero la cotización actual tampoco está mal dada la calidad de la compañía.\r\n','https://proyecto4millones.blogspot.com/2018/04/candidatos-la-compra-del-mes-de-abril_4.html',162,1,'2018-04-05 15:59:13','2018-04-05 15:59:13','2018-04-05'),(206,'Al igual que en los últimos meses, Pfizer sigue estando infravalorada. Sé que hay inversores que quieren ver la cota de 4 % de rentabilidad por dividendo antes de comprar la acción. Eso corresponde con un precio de 34 $. En estos momentos Pfizer cotiza a 35,60 $ y paga una rentabilidad de 3,81 % Nosotros no nos ponemos exquisitos y, considerando que es un valor central de nuestra cartera, nos bastaría la imagen de infravaloración de FastGraphs y la opinión de Morningstar (4 estrellas) para ampliar la posició','https://proyecto4millones.blogspot.com/2018/04/candidatos-la-compra-del-mes-de-abril_4.html',151,1,'2018-04-05 15:59:52','2018-04-05 15:59:52','2018-04-05'),(207,'Cuatro estrellas Morningstar y una imagen de FastGraphs que muestra la compañía adecuadamente valorada son las credenciales de esta empresa del sector del entretenimiento. El precio lleva 3 años bastante estancado, en una corrección temporal (hay correcciones en las que el precio baja y otras en las que el precio no se mueve durante un tiempo), oportunidad para ir construyendo una posición. ','https://proyecto4millones.blogspot.com/2018/04/candidatos-la-compra-del-mes-de-abril_4.html',166,1,'2018-04-05 16:00:25','2018-04-05 16:00:25','2018-04-05'),(208,'Esta compañía integrada de petróleo ofrece en estos momentos una rentabilidad superior al 4,10 % (una de las más altas en la imagen de FastGraphs, aunque hay que tener en cuenta que ofrece solo la rentabilidad del último día de cada año) y está comprometida con el accionista. Morningstar juzga su precio actual como infravalorado (cuatro estrellas) y en la imagen de FastGraphs podría bajar hasta 68 $ antes de empezar su infravaloración. Al precio actual podríamos entrar, dado que tenemos en cartera solo media posición de la empresa.','https://proyecto4millones.blogspot.com/2018/04/candidatos-la-compra-del-mes-de-abril_4.html',141,1,'2018-04-05 16:00:57','2018-04-05 16:00:57','2018-04-05'),(209,'Mr Free dice que el precio justo serían 75$','http://dailytradealert.com/2018/04/01/undervalued-dividend-growth-stock-of-the-week-151/',126,1,'2018-04-05 16:03:56','2018-04-05 16:03:56','2018-04-05'),(210,'Al farmaceutico le gusta','http://www.elfarmaceuticoactivo.com/2018/03/sector-retail-salud-oportunidad.html',186,1,'2018-04-05 16:48:54','2018-04-05 16:48:54','2018-04-05'),(211,'El beneficio neto de 2017 es de 4.857M$, reduciéndose un 23% desde los 6.329M$ y un BPA que queda en 3,38$ (también con una reducción del 23%). Sin embargo, si revisamos el BPA comparable (sin efectos del cargo debido a la nueva reforma fiscal y de tipo de cambio) se produce un incremento del 9%.\r\nLa generación de caja se reduce ligeramente (9.994M$, -4%), que con un Capex de 2.969M$ nos deja un Free Cash Flow de 7.025M$ (se reduce un -4,6%). En cualquier caso este FCF es suficiente para cubrir la retribución al accionista, tanto la recompra de acciones (2.000M$) como el pago del dividendo (4.472M$), lo que permite reducir un poco la deuda.','http://invertirendividendos.com/resumen-resultados-2017-eng-ko-pep/',148,1,'2018-04-13 21:45:47','2018-04-13 21:45:47','2018-03-13'),(212,'En 2017 continua con su política de desinversión de las embotelladoras con peores márgenes, tratando de reorientar su negocio hacia las operaciones de mayor retorno y márgenes (el margen de operación le ha subido un 3,5% en el año, 62,6% de margen bruto) y menores necesidades de inversión. Sin embargo, todos estos cambios suponen efectos a corto plazo en los resultados anuales.\r\nLas ventas netas de 2017 se reducen un 15% (hasta los 35.410M$) por este efecto. Sin embargo, los ingresos orgánicos (comparables) vuelven a crecen un 3% después de varios estancados, fundamentalmente basado en un incremento de precio medio del 3%, ya que el volumen ha permanecido constante en 2017.\r\nEl beneficio neto antes de impuestos cae un 17% (6.742M$, por los 8.100M$ del año anterior).\r\nPor otra parte, la reforma fiscal beneficiará a la empresa a largo plazo (la tasa efectiva pasa del 26% al 21%), pero el pago de impuestos por la repatriación de los beneficios generados fuera de USA supone un cargo de unos 3.600M$ en este ejercicio que va recortar significativamente los resultados netos de 2017 (el pago de impuestos en 2017 suponen 5.500M$ sobre 1.500M$ en 2016). Beneficio neto de 1.248M$ (-81%) y BPA de 0,29$.\r\nLa generación de caja se reduce un 20% (7.000M$) y el Free Cash Flow un 19% (5.320M$) debido principalmente a la venta de las embotelladoras de Norteamérica. Ahora mismo esta lejos de cubrir el pago de dividendos (6.320M$) y la recompra de acciones (3.600M$), por lo que en parte de la retribución al accionista se está financiando con deuda.\r\nLa compañía espera reducir la deuda en 2018 en 7.000M$ con caja que actualmente se encuentra fuera de USA, manteniendo el ratio Deuda Neta/EBITDA en el rango 2-2,5 como es su objetivo.\r\nFitch acaba de rebajar el rating de Coca-Cola a “A” desde “A+”','http://invertirendividendos.com/resumen-resultados-2017-eng-ko-pep/',171,1,'2018-04-13 21:46:26','2018-04-13 21:46:26','2018-03-13'),(213,'La deuda neta “stand-alone” (sin contar la integración de GNL Quintero) se ha reducido notablemente este año, pasando de 5.089M€ a cierre de 2016 hasta los 4.364M€ a cierre de 2017 (unos 725M€ de reducción). Esto supone pasar de un ratio Deuda neta/EBITDA de 5,2 en 2016 a 4,4 en 2017.\r\nSi contamos la integración en las cuentas de GNL Quintero, la deuda neta queda a final de 2017 en 5.098M€ (al incluir la parte de deuda de GNL Quintero se queda casi igual que en el año anterior), pero el incremento del EBITDA deja en ratio en 4,4 en 2017 (igual que sin integrar).\r\nEste valor de ratio (4,4) es más razonable, todavía algo más alto de lo que me gustaría (por debajo de 4), pero más razonable que los 5,2 de 2016.\r\nEl 80% de la deuda es a tipo fijo y el coste medio está en 2,2% (2,7% si integramos GNL Quintero).\r\nEl rating por S&P y Fitch se ha reafirmado este año en “A-“, de las mejores empresas españolas.','http://invertirendividendos.com/resumen-resultados-2017-eng-ko-pep/',24,1,'2018-04-13 21:47:15','2018-04-13 21:47:15','2018-03-13'),(214,'Tesis de inversión de Magallanes en Inditex','https://www.finect.com/document/642bcb13a1ee376c1f6d085fea4310e49e3f0a29964',173,1,'2018-04-16 13:18:13','2018-04-16 13:18:13','2018-04-16'),(215,'La paso a rojo porque vuelve a ganar un 4% menos que el anterior trimestre','',158,1,'2018-04-18 13:25:21','2018-04-18 13:25:21','2018-04-18'),(216,'El Nick mackintosh dice que: \"Even after the 16% drop PM is still overvalued, not buying with a P/FCF of 17\"','https://www.cazadividendos.com/foros/tema/philip-morris-pm-pmi/',195,1,'2018-04-20 13:34:26','2018-04-20 13:34:26','2018-04-20'),(217,'Reducción del Beneficio hasta los 187 millones (-9.3%) en primer trimestre de 2018:','',28,1,'2018-04-30 16:14:04','2018-04-30 16:14:04','2018-04-30'),(218,'Resultados de los últimos nueve meses:\r\n\r\nBeneficio: 7.698 millones de dólares (-55%).\r\nFacturación: 80.275 millones (+13%).\r\nBeneficio antes de impuestos: 25.794 millones (+17%).\r\nEl problema es que ha tenido que hacer provisiones extraordinarias para la reforma fiscal por valor de 18.096 millones.','',29,1,'2018-04-30 16:17:37','2018-04-30 16:17:37','2018-04-30'),(219,'Resultados del primer trimestre de 2018:\r\n\r\nBeneficio: 31,7 millones (+0,2%).\r\nFacturación: 187,7 millones (-3,5 %).\r\nEbitda: 43,2 millones (-15,3 %).\r\nDeuda: 28,3 millones (-31,1 %).','',123,1,'2018-04-30 16:18:07','2018-04-30 16:18:07','2018-04-30'),(220,'As I said, KHC had a decent report – probably better than most expected – but contained absolutely no forward guidance. I remain leery.','',168,1,'2018-05-03 16:24:12','2018-05-03 16:24:12','2018-05-03'),(221,'HCP with a nice little earnings report. There have been good, earnings-related bouncebacks by the likes of VTR and WELL, so we’ll see if HCP has one too.','',27,1,'2018-05-03 16:24:27','2018-05-03 16:24:27','2018-05-03'),(222,'The stock is basically a cash cow. And that’s why it’s a major position in my FIRE Fund.','http://dailytradealert.com/2018/05/06/undervalued-dividend-growth-stock-of-the-week-156/',148,1,'2018-05-08 12:31:07','2018-05-08 12:31:07','2018-05-08'),(223,'Aquí dicen que como máximo pagar 50 USD. \r\nDicen que debemos ser exigentes con ella a la hora de añadirla a nuestra cartera y más cuando ha tenido un crecimiento tan ligero del dividendo en los últimos años. A esto se añade que actualmente esta sobrevalorada por PER y que el BPA parece haberse estancado los últimos años. Por el lado bueno destacar que valores como el payout y la deuda/patrimonio neto están dentro de los parámetros que consideraríamos buenos. ','http://www.objetivoindependenciafinanciera.es/2017/03/analisis-cincinnati-financial-cinf.html',138,1,'2018-05-10 13:02:25','2018-05-10 13:02:25','2018-03-27'),(224,'u negocio no es solo de tabaco, sino de vino y cerveza (con una participación del 10 % en la cervecera Anheuser-Busch InBev). En el último año la empresa ha anunciado no uno, sino dos aumentos del dividendo, y le ha permitido llegar a la cifra de 49 años consecutivos de incremento del dividendo (el descenso que se ve en la imagen siguiente corresponde a los spin-off sucesivos de Kraft y Philip Morris).\r\n\r\nAltria ofrece una rentabilidad de 5,03 % en estos momentos, cuando su rentabilidad media en los últimos cinco años ha sido de 4,01 %. El crecimiento del dividendo en los últimos cinco años ha sido de un 8,32 % anual. El dividendo parece relativamente seguro, pues el EPS payout fue en 2017 de un 41,24 %, pero el FCF payout se situó en el 101,78 %. David Fish estima un crecimiento de un 9,63 % anual en los próximos cuatro años.\r\nEn cuanto a la valoración, Morningstar le asigna cuatro estrellas y en la imagen de FastGraphs Altria parece cotizar alrededor de su precio justo.','https://proyecto4millones.blogspot.com/2018/06/candidatos-la-compra-del-mes-de-junio.html',197,1,'2018-06-04 13:07:33','2018-06-04 13:08:01','2018-06-04'),(225,'Fortis es una las compañías norteamericanas más importantes de servicios públicos. Con sede en Canadá, la compañía se ha expandido tanto en su país de origen como en Estados Unidos y el Caribe. La mayor parte de su negocio es regulado y eso le da una cierta seguridad. En 2017 superó por primera vez la marca de 1.000 millones de dólares de beneficio neto. Su retorno anual total ha sido superior al índice S&P 500 en los últimos 10 años. En estos momentos paga una rentabilidad por dividendo superior al 4 % y ha anunciado un aumento del 6 % anual en su dividendo hasta el año 2020. Finalmente, su cotización actual está alrededor de su precio justo. \r\nEl día 11 de junio compramos 20 acciones de Fortis a un precio de 31,3385 $ (inversión total 626,77 $). Estas acciones llevan la posición que tenemos en cartera al tamaño de una posición completa. Las 32 acciones de Fortis nos abonarán aproximadamente (dependerá del tipo de cambio CADUSD) $41,20 anuales.','https://proyecto4millones.blogspot.com/2018/06/compra-del-mes-de-junio-de-2018-fortis.html',199,1,'2018-06-17 17:50:16','2018-06-17 17:50:16','2018-06-17'),(226,' los 18$ es una zona estupenda de comprar. Yo compré algo por esa zona y luego más arriba porque creo que la empresa tiene mucho más valor, no veo problemas en los dividendos y esperar en estos rangos es algo que no me preocupa en exceso. Con que la empresa avance un 5% anual y cobre un dividendo del 10% ya estoy en un rango estupendo para lo que busco. La empresa hizo máximos históricos cerca de 31$ hace tiempo, pero sigo pensando que no la vendería por menos de 55$ ya que aquí los dividendos en relación al capital ya son pequeños. Por debajo del 5% hay que empezar a pensar en rotar y buscar otra zona de inversión ya que estas empresas en general no suelen revalorizar demasiado salvo que el ambiente acompañe mucho y la inflación un poquito. Mientras los tipos tengan aspecto alcista los inversores tendrán miedo, peor en el momento que le ambiente cambie, al final, el valor y la cotización tenderán a converger, vendrá una época de euforia y se podrá rotar el valor sin problemas. Yo mientras siga cobrando estos jugosos dividendos no me plantea muchos problemas y como no veo problemas entre los inquilinos, no veo peligros que asolen mis dividendos.','http://www.eldividendo.com/select-income-reit/',200,1,'2018-06-17 17:53:50','2018-06-17 17:53:50','2018-06-17'),(227,'Abro este tema sobre esta empresa que para mí era desconocida por ese nombre, conocía a una de las empresas de la que es propietaria Ogilvy. Se dedica al márketing y publicidad. La he conocido por una referencia que ha hecho a ella en el blog el monje paciente y me ha gustado mucho, la he añadido a mi cartera. \r\n\r\nEsto es lo que pone de ella wikipedia:\r\n\r\nWPP (iniciales de Wire and Plastic Products en idioma inglés) es una empresa de servicios de marketing y comunicaciones del Reino Unido. Fue fundada en 1971 con fines industriales y adquirida en 1985 para entrar a la industria publicitaria. La empresa está presidida por su fundador, sir Martin Sorrell.\r\n\r\nEstadísticas y datos importantes:1​\r\n\r\nNúmero de empleados: 205.000 (incluyendo empresas asociadas e inversiones)\r\nNúmero de oficinas: 3.000\r\nNúmero de países: 112\r\nVentas: £14.4bn (a Diciembre de 2016)\r\nValor de mercado: £21.4bn (a Abril de 2016)\r\n\r\nEmpresas de propiedad del grupo WPP\r\n\r\nPublicidad:\r\n\r\nOgilvy & Mather, fundada por David Ogilvy\r\nGrey\r\nYoung & Rubicam (Y&R)\r\nJWT\r\n\r\nAdministracion de Datos\r\n\r\nKantar\r\n\r\nServicios Digitales\r\n\r\nWunderman\r\nVML\r\nAKQA\r\nPossible\r\n\r\nInversion en Medios\r\n\r\nGroupM, confirmada por las empresas de medios: Mindshare, MediaCom, MEC, Maxus, Essence y Xaxis\r\n\r\nRelaciones Públicas\r\n\r\nBurson-Marsteller\r\nCohn & Wolfe\r\nHill+Knowlton\r\n\r\n\r\n\r\n\r\nEl historial de dividendo es impresionante:\r\n\r\n2017 2016 2015 2014 2013 2012 2011 2010 2009\r\n60.00p 56.60p 44.69p 38.20p 34.21p 28.51p 24.60p 17.79p 15.47p\r\n\r\nEl PER es de 9,62 y el payout es del 48%.\r\nDesde febrero de 2017 ha estado bajando bastante; hoy está sobre 12,4 libras y llegó a estar en 18,97. De todas formas parece que ha hecho suelo en marzo de este año. Este año también ha tenido algunos sustos debido a un escándalo protagonizado por su presidente que ha dimitido. \r\nMe gustaría saber mas cosas sobre ella, si me entero de mas cosas las compartiré por aquí.','http://www.invertirenbolsa.info/foro-inversiones/showthread.php?12465-WPP-An%E1lisis-fundamental-y-t%E9cnico',198,1,'2018-06-19 07:25:50','2018-06-19 07:25:50','2018-06-19'),(228,'Profit warning por el aumento de aranceles en China a los coches fabricados en USA.','https://www.daimler.com/documents/investors/news/capital-market-releases/daimler-mercedes-benz-ir-release-en-20180620.pdf',170,1,'2018-06-21 08:07:48','2018-06-21 08:07:48','2018-06-21'),(229,'Fuertes bajadas (10%) por reducir previsiones de ventas. Aumentan 20% el dividendo para compensar','https://proyecto4millones.blogspot.com/2018/06/starbucks-aumenta-un-20-su-dividendo.html',201,1,'2018-06-24 09:06:02','2018-06-24 09:06:02','2018-06-24'),(230,'Las ventas crecen sanas si lo miramos por acción, los beneficios y los dividendos también. Si los tipos se vuelven alcistas, la empresa tendrá que tener cuidado con los dividendos que paga y puede que no vayan a seguir siendo crecientes como lo han sido hasta ahora desde su creación, pero no veo grandes problemas para esta empresa en este aspecto, el negocio va bien y los cambios que han hecho me han parecido buenos, por lo que creo que van en la línea correcta.','http://www.eldividendo.com/sabra-health-care/',202,1,'2018-06-24 09:12:46','2018-06-24 09:12:46','2018-06-24'),(231,'provides a necessary and ubiquitous service to millions of captive consumers, all in a monopolistic setting. That allows them to pay a huge, reliable, and growing dividend to yield-hungry investors. With improving fundamentals, a 6%+ yield, 17 consecutive years of dividend raises, and the potential that shares are 31% undervalued, this dividend growth stock could electrify your portfolio.','http://dailytradealert.com/2018/05/20/undervalued-dividend-growth-stock-of-the-week-158/',203,1,'2018-06-24 09:33:27','2018-06-24 09:33:27','2018-06-24'),(232,'A Jason Fieber le da un precio justo de $41.20 y la considera undervaluated','http://dailytradealert.com/2018/04/29/undervalued-dividend-growth-stock-of-the-week-155/',19,1,'2018-06-24 09:53:59','2018-06-24 09:53:59','2018-06-24'),(233,'Jason dice que el dividendo es muy seguro y que está undervaluated','http://dailytradealert.com/2018/04/22/undervalued-dividend-growth-stock-of-the-week-154/',163,1,'2018-06-24 10:14:08','2018-06-24 10:14:36','2018-04-22'),(234,'Jason la considera undervaluated pero con el dividendo poco seguro. ','http://dailytradealert.com/2018/04/08/undervalued-dividend-growth-stock-of-the-week-152/',135,1,'2018-06-24 10:49:37','2018-06-24 10:49:37','2018-04-08'),(235,'Resumiendo un poco todo, hoy tenemos una empresa que se puede adaptar muy bien a la filosofía que tenemos por aquí para invertir. La hemos mirado en un año difícil y que nos quita mucha información, pero hemos tratado de ajustar todo lo que hemos podido. A pesar de todo el pasado cuenta en este negocio y ciertos lastres pesan, soy flexible pero no puedo obviar ciertas cosas. El balance está muy justo, sé que será transitorio, pero no está como quiero. La cuenta de resultados es un jaleo por cosas que pasarán, pero que están y el flujo de caja está sano, que no es poco. Los beneficios crecen, los dividendos demasiado. La deuda es grande pero los gastos financieros no tanto. El negocio me gusta y la directiva también, creo que lo están haciendo bien, pero los márgenes a pesar de mejorar no llegan a lo que yo exijo para la máxima categoría. Voy a calificar plata en verde y hasta un 5% en una cartera ElDividendo, pero hoy tengo que dar ciertos avisos. Esta empresa no es para cualquiera, requiere de una cierta experiencia y conocimiento por parte del inversor. ','http://www.eldividendo.com/rpc-group/',204,1,'2018-06-25 07:53:09','2018-06-25 07:53:09','2016-06-25'),(236,'General Electric separa el negocio de salud en una compañía independiente. Sube un 5%','https://elpais.com/economia/2018/06/26/actualidad/1530011474_070429.html',169,1,'2018-06-28 09:06:53','2018-06-28 09:06:53','2018-06-26'),(237,'Está muy cara (80), la paso a amarillo','',161,1,'2018-06-29 14:59:18','2018-06-29 14:59:18','2018-06-29'),(238,'Trabajo fin de Master sobre Ebro Foods, septiembre 2016','https://riunet.upv.es/bitstream/handle/10251/71637/MORCILLO%20-%20VALORACI%C3%93N%20ECON%C3%93MICA%20DE%20LA%20EMPRESA%20EBRO%20FOODS%2C%20S.A..pdf?sequence=1',125,1,'2018-08-03 08:39:30','2018-08-03 08:39:30','2018-08-03');
